import React ,{Component} from 'react';
import logo from './logo.svg';
import './App.css';
import { react } from '@babel/types';

class App extends Component{
  render(){
    return(
      <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
         heyaaaa
        </p>
      <button>
        change text
      </button>
      </header>
    </div>

    )

  }
}

export default App;
